description:
NewBridge Services is a nonprofit provider of counseling services, housing and educational programs. NewBridge is committed to bringing balance to people’s lives and is a trusted partner with communities in northern New Jersey. Last year alone, NewBridge served nearly 8,000 children, adults and seniors. NewBridge:
treats mental illnesses and addictions; teaches coping skills and resiliency to children through in-school prevention programs; counsels individuals and families so they can deal with stress, grief and challenging relationships; helps children who have been abused and neglected — and their families — heal; runs a successful alternative education and career program for at-risk young adults; supports seniors so they can live as independently as possible; performs psychological first aid for communities in crisis; provides affordable homes for people with special needs;
supports people with mental illness in the community; and provides in-home mental health counseling to homebound seniors and caregivers.NewBridge’s 180 full- and part-time employees, including 58 licensed and certified professionals, are its heart.

content:
La nature, source de nos produits laitiers.
L'innovation, cœur de nos compétences.


Constituée en 1927 en société anonyme, Cremo est une société suisse fabriquant et commercialisant des produits laitiers de haute qualité, de manière constante et durable, en Suisse et dans le monde. 

L'entreprise est active au sein de quatre domaines d'activités d'importance:
- les produits frais, tels que laits, crèmes, yogourts, boissons lactées;
- les fromages à pâte dure et mi-dure, tels que le Gruyère AOP, le Vacherin fribourgeois AOP, l'Emmentaler     
  AOP, le fromage à raclette du Valais AOP Valdor, Raclette Mazot et l'Edam Suisse;
- les beurres;
- et les ingrédients tels que poudres de lait et concentrés de protéines.

Son actionnariat est composé majoritairement de producteurs de lait. Aujourd'hui, elle occupe la deuxième place des transformateurs de lait en Suisse.

